<header id="site-header">
	<div class="header-wrapper">
        <div class="header-spacer"></div>
        <!-- for following svg -->
        <style type="text/css">
        /* --- Keyframes --- */
        @keyframes fade-in {
            from {
                opacity: 0;
            }

            to {
                opacity: 1;
            }
        }
        @keyframes blink {
            to {
                transform:scale(0.3,0.3);
            }
        }

        /* --- General Styles --- */
        text {
            font-family: 'Lato', sans-serif;
        }
        .primary {
            fill: #FFFFFF;
        }
        .accent {
            fill: #E05036;
        }
        .link-label {
            font-size: 18px;
            fill: #E05036;
        }
        .fadeIn {
            animation-name: fadeIn;
        }
        .blink {
            animation-name: blink;
            animation-timing-function: ease-in-out;
            animation-duration: 1s;
            animation-iteration-count: infinite;
            animation-direction: alternate;
        }
        .link {
            cursor: pointer;
        }

        /* --- Elements --- */

        #title {
            animation-name: fade-in;
            animation-duration: 1.5s;
            font-weight: normal;
        }
        #subtitle {
            font-weight: lighter;
        }
        #corps-badge, #subtitle {
            opacity: 0;
            animation-name: fade-in;
            animation-duration: 1.5s;
            animation-delay: .5s;
            animation-fill-mode: forwards;
        }

        #youth-link, #team-link, #equipment-link, #info-link, #tentrental-link {
            opacity: 0;
            animation-name: fade-in;
            animation-duration: 1s;
            animation-fill-mode: forwards;
        }

        #youth-link {
            animation-delay: 3s;
        }
        #team-link {
            animation-delay: 3.1s;
        }
        #equipment-link {
            animation-delay: 3.2s;
        }
        #info-link {
            animation-delay: 3.3s;
        }
        #tentrental-link {
            animation-delay: 3.4s;
        }

        #youth-animation {
            animation-delay: 0.0s;
        }
        #team-animation {
            animation-delay: 0.2s;
        }
        #equipment-animation {
            animation-delay: 0.4s;
        }
        #info-animation {
            animation-delay: 0.6s;
        }
        #tentrental-animation {
            animation-delay: 0.8s;
        }
        </style>
